const Menu = lazy(() => import('./code-splitting/Menu/Menu.js'));
const Rodape = lazy(() => import('./code-splitting/Footer/Rodape.js'));


function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <header>
          <Suspense fallback={<p>Carregando...</p>}>
            <Menu />
          </Suspense>
        </header>
        <main>
          <Container>
            <Rotas />
          </Container>
        </main>
        <Suspense fallback={<p>Carregando...</p>}>
          <Card.Footer>
            <Rodape />
          </Card.Footer>
        </Suspense>

      </div>
    </BrowserRouter >

  );
}

export default App;
